-- ============================================================================
-- PASO 3: ACTUALIZAR ESTADÍSTICAS DE COMUNAS
-- ============================================================================

-- Actualizar contadores y promedios de precios por comuna
UPDATE comunas c SET
    total_propiedades = (
        SELECT COUNT(*) 
        FROM propiedades p 
        WHERE p.comuna_id = c.id
    ),
    precio_promedio = (
        SELECT AVG(precio) 
        FROM propiedades p 
        WHERE p.comuna_id = c.id AND p.precio IS NOT NULL
    ),
    precio_m2_promedio = (
        SELECT AVG(precio / NULLIF(superficie_total, 0)) 
        FROM propiedades p 
        WHERE p.comuna_id = c.id 
            AND p.precio IS NOT NULL 
            AND p.superficie_total IS NOT NULL 
            AND p.superficie_total > 0
    );

